import { Component, ViewChild } from '@angular/core';
import { WallComponent } from '../wall/wall.component';
import { SearchComponent } from '../search/search.component';
import { CategoriesComponent } from '../categories/categories.component';
import { UserProfileComponent } from '../user-profile/user-profile.component';
import { NotificationsComponent } from '../notifications/notifications.component';

import { UsersService } from '../../services/users.service';
import { NotificationsService } from '../../services/notifications.service';

import { NotificationModel } from '../../models/notification.model';


import { NavController, NavParams } from 'ionic-angular';
import { EditUserUploadComponent } from '../edit-user-upload/edit-user-upload.component';
import { PhotosService } from '../../services/photos.service';
import { PhotoModel } from '../../models/photo.model';
import { CategoryModel } from '../../models/category.model';
import { UserUploadModel } from '../../models/user-upload.model';

@Component({
    selector: 'main-menu',
    templateUrl: 'main-menu.html'
})
export class MainMenuComponent {

    private _wallTab: Component;
    private _searchTab: Component;
    private _addTab: Component;
    private _profileTab: Component;
    private _notificationsTab: Component;

    private _newNotifications: number = 0;

    constructor(private notificationsService: NotificationsService, private usersService: UsersService
    , private navCtrl: NavController, private photosService: PhotosService) {
        let isEditDebug: Boolean = false;

        if (!isEditDebug) {
            this._wallTab = WallComponent;
            this._searchTab = SearchComponent;
            this._addTab = CategoriesComponent;
            this._profileTab = UserProfileComponent;
            this._notificationsTab = NotificationsComponent;

            this.notificationsService.listen().subscribe(notification => {
                if (notification.isRead == false)
                    this._newNotifications++;
            });
        }
        else {
            this.photosService.getPhotosByCategory(2).subscribe(photos =>  {
            let userUpload: UserUploadModel = new UserUploadModel();
            userUpload.photo = photos[0];
            userUpload.user = this.usersService.loggedInUser;
            userUpload.image = "";

            this.navCtrl.push(EditUserUploadComponent, {
                userUpload: userUpload
            });
        });
        }
    }

    private resetNotifications() {
        if (this._newNotifications > 0) {
            this.notificationsService.markNotificationsAsRead().subscribe(() => this._newNotifications = 0);
        }
    }
}